def _min_cost(cost, m, n):
    # perform a successful Breadth-First Search
    queue = [
        (m, n), 
        (m - 1, n), 
        (m, n - 1)
    ]

    visited = set()
    while queue: 
        curr = queue.pop(0)
        visited.add(curr[0] + curr[1])
        if (curr[0] == 0 and curr[1] == 0): 
            break
        for i in range(-1,2): 
            for j in range(-1,2): 
                if (i != 0 and j != 0): 
                    if (cost[curr[0] + i][curr[1] + j] == 0): 
                        continue
                    queue.append((curr[0] + i, curr[1] + j))
        queue.append((-1, -1))
    return visited
