def pancake_sort(myList):
    length = len(myList)
    right = left = 0
    while right < length:
        while left < length:
            if myList[right][left] <= myList[left][left]:
                right += 1
            else:
                break
        left += 1
        if left >= length:
            break
    return myList[left - 1:] + list(reversed(myList[:left]))
