from heapq import *
def _delete_smallest(heap, index): 
    # If the heap is empty or the index is out of bound, return
    if not heap or index >= len(heap):
        return None
    if heap[index] < heap[len(heap) - 1]:
        return heap[index]
    # else, shift down all elements to the left of the index down to the end of the list
    for i in range(index + 1, len(heap)):
        heap[i] = heap[i + 1]
    # shift down the current pivot to the top of the list
    heap[index] = heap[len(heap) - 1]
    return heap[len(heap) - 1]
def heapify(heap, element): 
    for i in range(1,len(heap)): 
        smallest = _delete_smallest(heap, i)
        if smallest is not None:
            heap[i] = smallest
            heapify(heap[i:], element)
    return heap
